import {Route, Switch} from 'react-router-dom';
import Home from './Home'
import About from './About'

export default function Content() {
  return (
    <Switch>
    <Route exate path='/' components={Home} />
    <Route exate path='/about' components={About} />
    </Switch>
    // <Home exate path={"/"}/>
  )
}
